//设置一级菜单 id为一级菜单id 
function getFirst_xk(id){
	var obj=document.getElementById(id);
	for(var i=0;i<data_xk1.length;i++){
		if(data_xk1[i].substring(2,7)=="00000"){
			obj.options.add(new Option(data_xk2[i],data_xk2[i]));
		}
	}
}
//设置二级菜单  str为一级菜单选中的值
function getSecond_xk(id,str){
	var obj=document.getElementById(id);
	for(var i=0;i<data_xk2.length;i++)
		if(data_xk2[i]==str)
			str=data_xk1[i];
	for(var i=0;i<data_xk1.length;i++){
		if(data_xk1[i].substring(5,7)=="00"&&data_xk1[i].substring(2,5)!="00"&&data_xk1[i].charAt(0)==str.charAt(0)){
			obj.options.add(new Option(data_xk2[i],data_xk2[i]));
		}
	}
}
//设置三级菜单  str为二级菜单选中的值
function getThird_xk(id,str){
	var obj=document.getElementById(id);
	for(var i=0;i<data_xk2.length;i++)
		if(data_xk2[i]==str)
			str=data_xk1[i];
	for(var i=0;i<data_xk1.length;i++){
		if(data_xk1[i].substring(5,7)!="00"&&data_xk1[i].substring(0,5)==str.substring(0,5)){
			obj.options.add(new Option(data_xk2[i],data_xk2[i]));
		}
	}
}
//一级菜单改变是触发
function changefirst_xk(){
	var xkfl1=document.getElementById("demandClass1");
	var xkfl2=document.getElementById("demandClass2");
	var xkfl3=document.getElementById("demandClass3");
	xkfl2.options.length=0;
	xkfl3.options.length=0;
	var id=xkfl1.selectedIndex;
	getSecond_xk('demandClass2',xkfl1.options[id].value);
	changesecond_xk();
}
//二级菜单改变时触发
function changesecond_xk(){
	var xkfl1=document.getElementById("demandClass1");
	var xkfl2=document.getElementById("demandClass2");
	var xkfl3=document.getElementById("demandClass3");
	xkfl3.options.length=0;
	var id=xkfl2.selectedIndex;
	getThird_xk('demandClass3',xkfl2.options[id].value);
}
